Nanny McPhee (Emma Thompson) wordt ingehuurd om toezicht te houden op de zeven kinderen van meneer Brown. De kinderen hebben het 
niet zo op gouvernantes en hebben een reputatie hen snel weer de deur uit te werken. Nanny McPhee gebruikt echter magie om de 
kinderen het nodige bij te brengen..:
